// src/pages/LoginPage.js
import React from 'react';
import LoginForm from '../components/LoginForm';

const LoginPage = ({ history }) => {
  return (
    <div>
      <h1>Login</h1>
      <LoginForm history={history} />
    </div>
  );
};

export default LoginPage;
